import React from 'react';
import './RandomVideo.css';

import YouTubeVideo from '../YouTubeVideo/YouTubeVideo';

class RandomVideo extends React.Component {
  constructor(props){
    super(props);
  }

  render() {
    return (
    	<div className="random_video">
    		<h1 className="random_title">Random Video of Howard and Billy</h1>
    		<YouTubeVideo link={this.props.video.link} id={this.props.video.id} title={this.props.video.title} />
    	</div>
    );
  }
}

export default RandomVideo;
